import * as React from 'react';
import './App.css'
import dayjs, { Dayjs } from 'dayjs';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import ApexChart from './CandleChart.js';

export default function FormPropsTextFields() {
	const [valueEnd, setValueEndDate] = React.useState(dayjs('2014-08-18T21:11:54'));
	const [valueStart, setValueStartDate] = React.useState(dayjs('2014-08-18T21:11:54'));
	const [valueTicker, setValueTicker] = React.useState('TSLA');

	const handleChangeTicker = (newValueTicker) => {
		setValueTicker(newValueTicker);
	};
	const handleChangeStartDate = (newValueStartDate) => {
		setValueStartDate(newValueStartDate);
	};
	const handleChangeEndDate = (newValueEndDate) => {
		setValueEndDate(newValueEndDate);
	};
	return (
		<div class="choiceButtons" id="choiceButtons">
		<LocalizationProvider dateAdapter={AdapterDayjs}>
			<Stack direction="row" spacing={2}>
				<TextField
					id="outlined"
					label="Ticker"
					type="text"
					Value={valueTicker}
					onChange={handleChangeTicker}
					inputProps={{ maxLength: 5 }}
				/>
				<DesktopDatePicker
					label="Start Date"
					inputFormat="MM/DD/YYYY"
					value={valueStart}
					onChange={handleChangeStartDate}
					renderInput={(params) => <TextField {...params} />}
				/>
				<DesktopDatePicker
					label="End Date"
					inputFormat="MM/DD/YYYY"
					value={valueEnd}
					onChange={handleChangeEndDate}
					renderInput={(params) => <TextField {...params} />}
				/>
				<Button variant="contained"
				onClick={onTrigger(valueTicker)} >Text</Button>
			</Stack>
			</LocalizationProvider>
			<ApexChart />
		</div>
	);
}
